 import React from 'react';
 import ReactDOM from 'react-dom';
 import './index.css';
import App from './App';

function Card(){
    return(
        <div className="cards">
    <div className="card">
        <img src="https://wallpapercave.com/wp/wp4056410.jpg" alt="mypic" className="card_img"/>
        <div className="card__info">
            <span className="card__category"> A NetFlix Orginal Series</span>
            <h3 className="card__title">Dark</h3>
            <a href="https://www.netflix.com/in/title/80990668?source=35" target="_blank">
                <button> Watch Now</button>
            </a>

        </div>
    </div>
</div>     
    )
}

 ReactDOM.render( 
<Card/>,
     document.getElementById('root')
 );
